var choose_type = 0;
function show(type, th) {
    choose_type = type;
    $(".theme-list").removeClass('on');
    $(th).addClass('on');
    $(".product-list").each(function() {
        var cur_type = $(this).attr('data-theme').indexOf("," + type + ",");
        if (type == 0 || cur_type >= 0) {
            $(this).show();
        } else {
            $(this).hide();
        }
    })
}

function sort(type, name) {
    if (type == 1) {
        sort_arr.sort(sorttime);
    } else if (type == 2) {
        sort_arr.sort(sortdeal);
    } else if (type == 3) {
        sort_arr.sort(sortprice);
    } else {
        sort_arr.sort(sortzh);
    }

    $("#product-list").html();
    var html = '';
    for (i in sort_arr) {
        var cur_type = sort_arr[i]['theme_cate'].indexOf("," + choose_type + ",");
        var dispaly = 'style="display: none;"';
        if (choose_type == 0 || cur_type >= 0) {
            dispaly = '';
        }
        html = html + "<a  data-theme='" + sort_arr[i]['theme_cate'] + "' href='" + sort_arr[i]['src'] + "' class='item product-list' " + dispaly + ">\n" + "           <img class='pic' src='" + sort_arr[i]['cover_map'] + "' alt=''>\n" + "           <div class='con'>\n" + "               <div class='title'>" + sort_arr[i]['index_title'] + "</div>\n" + "               <div class='text'>" + sort_arr[i]['index_desc'] + "</div>\n" + "               <div class='info'>\n" + "                   <span class='price'>" + sort_arr[i]['price'] + "</span>\n" + "                   <span class='cost-price'>" + sort_arr[i]['yuanjia'] + "</span>\n" + "                   <span class='hit'>" + sort_arr[i]['people'] + "</span>\n" + "               </div>\n" + "           </div>\n" + "        </a>";
    }
    $("#product-list").html(html);
    $("#catSelect").removeClass('open');
    $("#sort-by").text(name);
}

function sortprice(a, b) {
    return a.price_sort - b.price_sort;

}
function sorttime(a, b) {
    return b.update_time - a.update_time;
}
function sortdeal(a, b) {
    return b.deal_num - a.deal_num;
}
function sortzh(a, b) {
    return a.zh_sort - b.zh_sort;
}
